import "./Dialogs.scss"

const DialogItem=(props)=>{
  let path="/dialogs/"+props.id;
  return(
    <li> <NavLink activeClassName="activeLinkDialogs" to={path}>{props.name}</NavLink></li>
  );
}

const Dialogs=()=>{
    let DialogsData=[
      {id:1,name:"Андрей"},
      {id:2,name:"Артём"},
      {id:3,name:"Егор"},
      {id:4,name:"Вадим"},
    ]

    return(<div className="Dialogs">
    <h3>Dialogs</h3>
    <ul>
      <DialogItem name={DialogsData[0].name} id={DialogsData[0].id}></DialogItem>
      <DialogItem name={DialogsData[1].name} id={DialogsData[1].id}></DialogItem>
      <DialogItem name={DialogsData[2].name} id={DialogsData[2].id}></DialogItem>
      <DialogItem name={DialogsData[3].name} id={DialogsData[3].id}></DialogItem>
      <DialogItem name="какой-то нуонейм" id='5'></DialogItem>
      <DialogItem name="какой-то ноунейм" id='6'></DialogItem>
      <DialogItem name="какой-то ноунейм" id='7'></DialogItem>
    </ul>
    </div>
    );
}

export default Dialogs
